<li>Natürliche Produkte, umweltfreundlich, recyclebar und eine sichere Wahl des Spielzeugs</li>
<li>Ungefähre Maße: 15 cm x   15 cm   x 0.5 cm</li>
<li>Verschiedene Tiere zur Auswahl.</li>
<li>Verfügbar für Kauf einzeln oder kombiniert auf mehr Porto zu sparen.</li>
</ul><p></p>

